import React, { useEffect, useState } from 'react';
import api from '../services/api';

interface Match {
	id: number;
	fixture: {
		id: number;
		player1: { id: number; name: string } | null;
		player2: { id: number; name: string } | null;
		round_number: number;
		match_number: number;
	};
	winner: { id: number; name: string } | null;
	status: string;
	scheduled_time: string;
	court_number: number | null;
}

const Results: React.FC = () => {
	const [matches, setMatches] = useState<Match[]>([]);
	const [loading, setLoading] = useState(true);
	const [error, setError] = useState('');
	const [sortBy, setSortBy] = useState<'date' | 'round'>('date');

	useEffect(() => {
		fetchResults();
	}, []);

	const fetchResults = async () => {
		try {
			const res = await api.get('/matches/?status=COMPLETED');
			setMatches(res.data);
			setError('');
		} catch (err) {
			console.error('Failed to fetch results:', err);
			setError('Failed to load match results');
		} finally {
			setLoading(false);
		}
	};

	const sortedMatches = [...matches].sort((a, b) => {
		if (sortBy === 'date') {
			return new Date(b.scheduled_time).getTime() - new Date(a.scheduled_time).getTime();
		} else {
			return a.fixture.round_number - b.fixture.round_number;
		}
	});

	const getWinnerScore = (match: Match) => {
		// This would need to be implemented based on your scoring system
		// For now, we'll show a placeholder
		return '21-15';
	};

	return (
		<div className="p-4 fade-in">
			<div className="card">
				<div className="card-header">
					<div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
						<h2 className="mb-0">üèÖ Match Results</h2>
						<div style={{ display: 'flex', gap: '0.5rem' }}>
							<button
								onClick={() => setSortBy('date')}
								className={`btn ${sortBy === 'date' ? 'btn-secondary' : 'btn-outline'}`}
								style={{ fontSize: '0.8rem', padding: '0.25rem 0.75rem' }}
							>
								üìÖ By Date
							</button>
							<button
								onClick={() => setSortBy('round')}
								className={`btn ${sortBy === 'round' ? 'btn-secondary' : 'btn-outline'}`}
								style={{ fontSize: '0.8rem', padding: '0.25rem 0.75rem' }}
							>
								üèÜ By Round
							</button>
						</div>
					</div>
				</div>
				<div className="card-body">
					{error && <div className="error">{error}</div>}

					{loading ? (
						<div className="loading">
							<div>Loading results...</div>
						</div>
					) : matches.length === 0 ? (
						<div className="text-center p-4">
							<div style={{ fontSize: '4rem', marginBottom: '1rem' }}>üèì</div>
							<h3>No completed matches yet</h3>
							<p className="text-muted">Results will appear here once matches are finished</p>
						</div>
					) : (
						<div className="table-responsive">
							<table className="table">
								<thead>
									<tr>
										<th>Round</th>
										<th>Match</th>
										<th>Players</th>
										<th>Winner</th>
										<th>Score</th>
										<th>Date</th>
										<th>Court</th>
									</tr>
								</thead>
								<tbody>
									{sortedMatches.map((match) => (
										<tr key={match.id}>
											<td>
												<span className="badge" style={{
													background: 'var(--accent-secondary)',
													color: 'white',
													padding: '0.25rem 0.5rem',
													borderRadius: '12px'
												}}>
													Round {match.fixture.round_number}
												</span>
											</td>
											<td>
												<span className="text-muted">#{match.fixture.match_number}</span>
											</td>
											<td>
												<div style={{ display: 'flex', flexDirection: 'column', gap: '0.25rem' }}>
													<span>{match.fixture.player1?.name || 'TBD'}</span>
													<span style={{ color: 'var(--text-muted)' }}>vs</span>
													<span>{match.fixture.player2?.name || 'TBD'}</span>
												</div>
											</td>
											<td>
												<div style={{
													display: 'flex',
													alignItems: 'center',
													gap: '0.5rem',
													fontWeight: '600',
													color: 'var(--accent-secondary)'
												}}>
													üèÜ {match.winner?.name || 'TBD'}
												</div>
											</td>
											<td>
												<span style={{ fontFamily: 'monospace', fontWeight: '500' }}>
													{getWinnerScore(match)}
												</span>
											</td>
											<td>
												<div style={{ fontSize: '0.9rem' }}>
													<div>{new Date(match.scheduled_time).toLocaleDateString()}</div>
													<div className="text-muted">
														{new Date(match.scheduled_time).toLocaleTimeString([], {
															hour: '2-digit',
															minute: '2-digit'
														})}
													</div>
												</div>
											</td>
											<td>
												{match.court_number ? (
													<span className="badge" style={{
														background: 'var(--bg-accent)',
														color: 'var(--text-primary)',
														padding: '0.25rem 0.5rem',
														borderRadius: '12px'
													}}>
														Court {match.court_number}
													</span>
												) : (
													<span className="text-muted">-</span>
												)}
											</td>
										</tr>
									))}
								</tbody>
							</table>
						</div>
					)}

					{matches.length > 0 && (
						<div className="mt-4 p-3" style={{
							background: 'var(--bg-accent)',
							borderRadius: 'var(--border-radius-md)',
							textAlign: 'center'
						}}>
							<h4 className="mb-2 court">Tournament Summary</h4>
							<div style={{ display: 'flex', justifyContent: 'center', gap: '2rem', flexWrap: 'wrap' }}>
								<div>
									<div style={{ fontSize: '1.5rem', fontWeight: 'bold' }}>{matches.length}</div>
									<div className="text-muted">Total Matches</div>
								</div>
								<div>
									<div style={{ fontSize: '1.5rem', fontWeight: 'bold' }}>
										{new Set(matches.map(m => m.winner?.id).filter(Boolean)).size}
									</div>
									<div className="text-muted">Unique Winners</div>
								</div>
								<div>
									<div style={{ fontSize: '1.5rem', fontWeight: 'bold' }}>
										{Math.max(...matches.map(m => m.fixture.round_number))}
									</div>
									<div className="text-muted">Rounds Played</div>
								</div>
							</div>
						</div>
					)}
				</div>
			</div>
		</div>
	);
};

export default Results;
